import React from 'react';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const CarouselTest = () => {
    const settings = {
        dots: true,
        infinite: true,
        // speed: 500,
        slidesToShow: 2,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1000,
        arrows: false,
    };

    return (
        <div>
            <div className='text'>meow meow</div>
            <Slider>
                <img src={require('../../photos/production/BKL_9167.jpg')} alt='Upload error' />
                <img src={require('../../photos/production/BKL_9167.jpg')} alt='Upload error' />
                <img src={require('../../photos/production/BKL_9167.jpg')} alt='Upload error' />
            </Slider>
        </div>
    );
};

export default CarouselTest;
